import React from 'react';
import styled from 'styled-components';

const NotFoundPage = () => {
  return (
    <Container>
      <Message>404 - Página Não Encontrada</Message>
    </Container>
  );
};

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  min-height: 80vh;
  color: #fff;
  text-align: center;
`;

const Message = styled.h1`
  font-size: 2rem;
`;

export default NotFoundPage;
